CREATE PROCEDURE dbo.proc_transform_296
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_296
    SET payload = LEFT(payload, 1000) + N'|V4-296|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_296;
END
